import './Concepts.css'
import Concept from './Concept'

const Concepts = (props) => {
    return (
        <div>
            {props.Concepts.map((concept, index) => (
                <Concept
                key={index}
                title={concept.title}
                image={concept.image}
                description={concept.description}
                />
            ))}
        </div>
    )
}

export default Concepts
